import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the modal (assuming there's a button to trigger it)
    await page.waitForSelector('.cta-button', { timeout: 5000 });
    await page.click('.cta-button');

    // Wait for the modal to be visible
    await page.waitForSelector('.mobile-menu-overlay', { timeout: 5000 });

    // Close the modal with the Escape key
    await page.keyboard.press('Escape');

    // Verify that the modal is closed
    const isModalClosed = await page.isVisible('.mobile-menu-overlay');
    if (!isModalClosed) {
      await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_closed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_modal_closed.png'));
    }

    return {
      success: true,
      action: "Closed modal with Escape key",
      extractedData: { modalClosed: !isModalClosed },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
